import React from 'react';
import Appbar from './components/AppBar';
import axios from 'axios';
import {useState} from 'react';
import './Cuisine.css';
/**
 * Simple component with no state.
 *
 * See the basic-react example for an example of adding and reacting to
 * changes in state and lecture 10 for details on Material-UI
 *
 * @return {object} JSX
 */
export default function Cuisine() {
  const [cuisineSelected, setCuisine] = useState('');
  const possibleCuisines = [
    {name: 'African'},
    {name: 'Asian'},
    {name: 'American'},
    {name: 'British'},
    {name: 'Cajun'},
    {name: 'Caribbean'},
    {name: 'Chinese'},
    {name: 'Eastern European'},
    {name: 'European'},
    {name: 'French'},
    {name: 'German'},
    {name: 'Greek'},
    {name: 'Indian'},
    {name: 'Italian'},
    {name: 'Japanese'},
    {name: 'Jewish'},
    {name: 'Korean'},
    {name: 'Latin American'},
    {name: 'Mediterranean'},
    {name: 'Mexican'},
    {name: 'Middle Eastern'},
    {name: 'Noradic'},
    {name: 'Southern'},
    {name: 'Spanish'},
    {name: 'Thai'},
    {name: 'Vietnamese'},
  ];
  console.log(possibleCuisines);
  // GET https://api.spoonacular.com/recipes/{id}/information
  const viewCuisine = (cuisine) => {
    axios
      .get(`https://api.spoonacular.com/recipes/complexSearch`, {
        params: {apiKey: 'c33d1c92ed8343d7b6522ddb630cdfd4', cuisine: cuisine},
      })
      .then((res) => {
        setCuisine(res.data);
      });
  };
  console.log(cuisineSelected);
  return (
    <div>
      <Appbar></Appbar>
      <h1 className='cuisinesTitle'>Cuisines</h1>
      <div className='cuisineOptions'>
        {possibleCuisines?.map((cuisine) => (
          <button
            style={{background: 'images/Asia.jpeg'}}
            key={cuisine.name}
            onClick={() => viewCuisine(cuisine.name)}
            className='cuisineButton'
          >
            {cuisine.name}
          </button>
        ))}
      </div>
    </div>
  );
}
